#!/bin/bash

rootkit_bin=''
rootkit_name='rootkit_test.ko'

if [ `id -u` == '0' ]
then
    echo 'je suis root! Lets go baby'
else
    echo 'je ne suis pas root, dommage...'
fi

#echo $rootkit_bin > $rootkit_name

cmd="'f=open(\"$rootkit_name\",\"wb\");f.write(\"$rootkit_bin\".decode(\"hex\"));f.close()'"

echo $cmd

python_cmd="python -c $cmd"
eval "$python_cmd"
echo "ret=$?"

